INSERT INTO `chatgpt_messages` VALUES (126,24,'チケットの類義語は？',10,'2023-04-18 12:57:14.357387','2023-04-18 12:57:14.357387');
INSERT INTO `chatgpt_messages` VALUES (127,24,'チケットの類義語には以下のようなものがあります。\n\n- パス（pass）\n- 券（ken）\n- 入場券（irikiken）\n- チケット券（ticket ken）\n- チケット要約（ticket voucher）\n- パスポート（passport）\n- チケットカード（ticket card）\n- 手形（tegata）\n- 鑑賞券（kanshōken）\n- クーポン（coupon）',20,'2023-04-18 12:57:21.873973','2023-04-18 12:57:21.873973');
INSERT INTO `chatgpt_messages` VALUES (128,24,'トークの類義語は？',10,'2023-04-18 12:59:48.367355','2023-04-18 12:59:48.367355');
INSERT INTO `chatgpt_messages` VALUES (129,24,'トークの類義語には、以下のようなものがあります。\n\n- 会話（conversation）\n- pl話（chat）\n- 対話（dialogue）\n- 友達とのおしゃべり（chitchat）\n- 口頭で意見を交わす（discuss）\n- 意見の交換をする（converse）\n- 打ち明け話（heart-to-heart talk）\n- 所感・感想（impression）\n- 情報交換（exchange of information）\n- ブレーンストーミング（brainstorming）',20,'2023-04-18 12:59:57.121533','2023-04-18 12:59:57.121533');
INSERT INTO `chatgpt_messages` VALUES (130,24,'スキマの類義語は？',10,'2023-04-18 13:00:53.151626','2023-04-18 13:00:53.151626');
INSERT INTO `chatgpt_messages` VALUES (131,24,'スキマの類義語には以下のようなものがあります。\n\n- 間隙（かんげき）\n- 隙間（すきま）\n- 空き時間（あきじかん）\n- すい間（すいかん）\n- 狭間（はざま）\n- 間（あいだ）\n- すそ野（すその）\n- 切れ目（きれめ）\n- 微細な隙間（ニュアンスの違いなど）：ニュアンス',20,'2023-04-18 13:01:00.901323','2023-04-18 13:01:00.901323');
