INSERT INTO `chatgpt_messages` VALUES (133,24,'スキマ時間の類義語には以下のようなものがあります。\n\n- ちょっとした時間（a little time）\n- 隙間時間（free time / spare time）\n- 雑務の合間（in-between tasks）\n- 空き時間（free time / spare time）\n- 暇な時間（idle time / leisure time）\n- 微振り時間（micro-breaks）',20,'2023-04-18 13:01:27.433840','2023-04-18 13:01:27.433840');
