INSERT INTO `chatgpt_messages` VALUES (147,24,'申し訳ありませんが、私は予定を作成する機能は持ち合わせていません。しかし、お使いのスマートフォンのカレンダーアプリやアシスタント機能を利用することで、簡単に予定を作成することができます。ご参考にしてみてください。',20,'2023-04-21 09:15:10.775407','2023-04-21 09:15:10.775407');
