INSERT INTO `chatgpt_messages` VALUES (151,36,'明日は何をするか私には情報がありませんので、お手伝いすることはできません。今日の予定をキャンセルしたい場合は、具体的にどのような予定があるのかによって異なりますが、必要に応じて担当者や参加者に連絡することをおすすめします。また、予定にかかわるチケットや予約がある場合は、早めに変更・キャンセル手続きを行うことが重要です。',20,'2023-04-30 07:39:25.226281','2023-04-30 07:39:25.226281');
